INSERT INTO `content` VALUES (1,'О портале','about','<div class=\"b-info__about\">\r\n	О портале\r\n</div>\r\n<div class=\"container\">\r\n<p>\r\n	Портал Valinta.ru (Валинта.ру) — это актуальная база специалистов по расчету и составлению сметной документации \r\n	в Санкт-Петербурге и других регионах Российской Федерации. \r\n</p>\r\n<p>\r\n	Портал будет полезен всем участникам строительной отрасли: как инженерам-сметчикам, так и организациям-заказчикам. \r\n	Удобный поиск специалиста по ключевым навыкам, месторасположению и стоимости услуг, открытые контакты делают наш\r\n	портал привлекательным для потенциальных работодателей.<br> \r\n	Простая, но подробная анкета для регистрации, возможность прямого общения с потенциальным заказчиком, специальное\r\n	предложение по бесплатному использованию сметной программы со всеми сметно-нормативными базами стало теми\r\n	преимуществами, что привлекают к нам на портал сметчиков.\r\n</p>\r\n\r\n<p class=\"b-info__last-parag\">\r\n	Предлагаем и Вам воспользоваться порталом Valinta.ru и по достоинству оценить его.\r\n</p>\r\n	<ul class=\"b-info__list\">\r\n		<li class=\"b-info__title\">\r\n			1. Регистрация на портале для сметчика\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			1.1. Перейдите в раздел «Регистрация в базе» и заполните анкету.  Обратите внимание на поля для обязательного заполнения.\r\n		</li>\r\n		<li class=\"b-info__image\">\r\n			<img src=\"/img/infograph/1.jpg\" alt=\"\">\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			1.2. Если поле заполнено верно, оно будет выделено зеленым, неверный вариант станет красным.\r\n		</li>\r\n		<li class=\"b-info__image\">\r\n			<img src=\"/img/infograph/2.jpg\" alt=\"\">\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			1.3. Не забудьте прочитать Пользовательское соглашение и поставить галочку, в случае Вашего согласия! \r\n		</li>\r\n		<li class=\"b-info__image\">\r\n			<img src=\"/img/infograph/3.jpg\" alt=\"\">\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			1.4. После того, как Вы поставили галочку на согласие с условиями, нажмете кнопку «Регистрация», и ни одно из полей не  станет\r\nкрасным вам на почту придет письмо с уведомлением. \r\nЭто значит,  что Ваша анкета ушла на модерацию.  По данным из письма Вы можете войти в свой личный кабинет на портале, где \r\nбудет вся информация об анкете и её статусе.\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			1.5. Если Ваша анкета успешно прошла модерацию, то она будет опубликована на портале, о чем Вы так же  будете уведомлены \r\nчерез e-mail. В случае возникших вопросов, неверных данных или ошибок с Вами свяжется наш менеджер, и после решения этих\r\nвопросов мы опубликуем Вашу анкету.\r\n		</li>\r\n		<li  class=\"b-info__subtitle\">\r\n			Более подробно о регистрации на портале Вы можете узнать по телефону 8 812 655-63-23 \r\n		</li>\r\n		<li class=\"b-info__title\">\r\n			2. Получение бесплатного доступа к сметной программе\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			2.1. Перейдите в раздел «Сметная программа бесплатно» и заполните форму.  Обратите внимание, что все поля обязательны\r\nдля заполнения.\r\n		</li>\r\n		<li class=\"b-info__image\">\r\n			<img src=\"/img/infograph/4.jpg\" alt=\"\">\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			2.2. Не забудьте прочитать Пользовательское соглашение и поставить галочку, в случае Вашего согласия! \r\n		</li>\r\n		<li class=\"b-info__image\">\r\n			<img src=\"/img/infograph/5.jpg\" alt=\"\">\r\n		</li>\r\n		<li class=\"b-info__item\">\r\n			2.3. После того, как Вы нажмете кнопку «Отправить», и если Вы указали верную почту, вам придет уведомление об отправке заявки. <br>\r\nПосле этого ожидайте звонка нашего менеджера.\r\n		</li>\r\n		<li class=\"b-info__subtitle\">\r\n			Более подробно о бесплатном доступе к сметной программе Вы можете узнать по телефону 8 812 655-63-23 \r\n		</li>\r\n	</ul>\r\n</div>',1,'2017-02-17 11:07:32'),(2,'Пользовательское соглашение','agreement','<div class=\"container\">\r\n<h1>Пользовательское соглашение</h1>\r\n		<p><strong>Valinta.ru</strong> (далее — «Портал») представляет данные о специалистах, занимающихся составлением и проверкой сметной документации, в их число могут входить как физические лица, так и организации, зарегистрированные на территории Российской Федерации. Информация о физических лицах и организациях предоставляется и актуализируется Пользователями.</p>\r\n		<h2>Общие положения</h2>\r\n		<p>Портал предлагает Пользователю использовать услуги на условиях, изложенных в настоящем Пользовательском соглашении (далее — «Соглашение»). Соглашение может быть изменено руководством Портала без какого-либо специального уведомления, новая редакция Соглашения вступает в силу с момента ее размещения, если иное не предусмотрено новой редакцией Соглашения. Пользовательское соглашение вступает в силу с момента выражения Пользователем согласия с его условиями путем регистрации на Портале или внесения изменений во введенные данные о компании.</p>\r\n		<p>Зарегистрировавшись на Портале или используя логин и пароль, предоставленные сотрудниками Портала для внесения и корректировки данных, Пользователь выражает свое безоговорочное согласие со всеми условиями настоящего Соглашения и обязуется их соблюдать или прекратить использование услуг Портала.</p>\r\n		<h2>Описание услуг</h2>\r\n		<p>Все существующие на данный момент услуги, а также любое развитие их и/или добавление новых, являются предметом настоящего Соглашения. Пользователь понимает и соглашается с тем, что все услуги предоставляются в их настоящем виде, что Портал не несет ответственности ни за какие последствия, вызванные внесением той или иной информации в базу данных Портала. Все вопросы подключения к сети Интернет, покупки и наладки для этого соответствующего оборудования и программных продуктов решаются Пользователем самостоятельно и не попадают под действие Соглашения.</p>\r\n		<h2>Обязательства Пользователя по регистрации</h2>\r\n		<p>Для того чтобы воспользоваться услугами Портала, Пользователь соглашается предоставить достоверную и полную информацию о себе по вопросам, предлагаемым в Форме Регистрации, а также обязуется поддерживать эту информацию в актуальном состоянии. Если Пользователь предоставляет неверную информацию или у Портала есть серьезные основания полагать, что предоставленная Пользователем информация неполна или недостоверна, Портал имеет право заблокировать либо удалить учетную запись Пользователя и отказать Пользователю в использовании своих служб.</p>\r\n		<p>Портал оставляет за собой право в любой момент потребовать подтверждения данных, указанных Пользователем при регистрации, и запросить подтверждающие документы, непредоставление которых может быть приравнено к предоставлению недостоверной информации.</p>\r\n		<h2>Регистрация, пароль и безопасность Пользователя</h2>\r\n		<p>По завершении процесса регистрации Пользователь может использовать предоставленные логин и пароль для доступа к персонализированной части служб Портала.</p>\r\n		<p>Пользователь несет ответственность за безопасность логина и пароля Пользователя, а также за размещение и корректировку информации, произведенные на Портале под логином и паролем Пользователя.</p>\r\n		<p>Пользователь соглашается немедленно уведомить техническую поддержку Портала о любом случае несанкционированного доступа с логином и паролем Пользователя и/или о любом нарушении безопасности.</p>\r\n		<p>Портал не отвечает за возможную потерю или искажение данных, что может произойти из-за нарушения Пользователем положений этой части Соглашения.</p>\r\n		<h2>Права собственности Портала</h2>\r\n		<p>Пользователь признает и соглашается с тем, что услуги Портала и все необходимые программы, связанные с ними, содержат конфиденциальную информацию, которая защищена законами об интеллектуальной собственности, другими российскими и международными законами, а контент, предоставляемый Пользователю в процессе использования служб, защищен авторским правом.</p>\r\n		<p>Кроме случаев, специально оговоренных Порталом или его рекламодателями, Пользователь соглашается не модифицировать, не продавать, не распространять этот контент целиком либо по частям.</p>\r\n		<h2>Общая информация</h2>\r\n		<p>Соглашение является юридически обязывающим договором, заключенным Пользователем и Порталом с целью регламентации использования услуг Портала. Соответствующими договорами на Пользователя также могут быть наложены дополнительные обязательства, связанные с использованием дополнительных услуг.</p>\r\n		<p>Пользователь и Портал соглашаются на то, что все возможные споры по поводу Соглашения будут разрешаться по нормам российского права.</p>\r\n		<p>Ввиду безвозмездности услуг, оказываемых в рамках Соглашения, нормы о защите прав потребителей не могут быть к нему применимыми. В случае, если Соглашению будет придан возмездный характер, в него будут внесены соответствующие изменения в целях соблюдения указанных норм. Признание судом какого-либо положения Соглашения недействительным или не подлежащим принудительному исполнению не влечет недействительности или неисполнимости иных положений Соглашения.</p>\r\n		<p>Бездействие со стороны Портала в случае нарушения Пользователем либо иными пользователями положений Соглашения не лишает Портал права предпринять соответствующие действия в защиту своих интересов позднее, а также не означает отказа Портала от своих прав в случае совершения в последующем подобных либо сходных нарушений.</p>\r\n<h2>Обработка персональных данных</h2>\r\n	<p>\r\n		Предоставляя свои персональные данные Пользователь даёт согласие на обработку, хранение и использование своих персональных\r\n		данных на основании ФЗ № 152-ФЗ «О персональных данных» от 27.07.2006 г. в следующих целях:\r\n	</p>\r\n	<ul>\r\n		<li>Регистрации Пользователя на сайте </li>\r\n		<li>Осуществление клиентской поддержки </li>\r\n		<li>Получения Пользователем информации о маркетинговых событиях </li>\r\n		<li>Выполнение Порталом обязательств перед Пользователем </li>\r\n		<li>Проведения аудита и прочих внутренних исследований с целью повышения качества предоставляемых услуг. </li>\r\n	</ul>\r\n	<p>\r\n		Под персональными данными подразумевается любая информация личного характера, позволяющая установить личность Пользователя\r\n		такая как:\r\n	</p>\r\n	<ul>\r\n		<li>Фамилия, Имя, Отчество</li>\r\n		<li>Контактный телефон </li>\r\n		<li>Адрес электронной почты </li>\r\n	</ul>\r\n	<p>\r\n		Персональные данные Пользователя хранятся исключительно на электронных носителях и обрабатываются с использованием автоматизированных\r\n		систем, за исключением случаев, когда неавтоматизированная обработка персональных данных необходима в связи с исполнением\r\n		требований законодательства.\r\n	</p>\r\n	<p>\r\n		Портал обязуется не передавать полученные персональные данные третьим лицам, за исключением следующих случаев:\r\n	</p>\r\n	<ul>\r\n		<li>\r\n			По запросам уполномоченных органов государственной власти РФ только по основаниям и в порядке, установленным законодательством\r\n			РФ\r\n		</li>\r\n	</ul>\r\n	<p>\r\n		Портал оставляет за собой право вносить изменения в одностороннем порядке в настоящие правила, при условии, что изменения\r\n		не противоречат действующему законодательству РФ. Изменения условий настоящих правил вступают в силу после их публикации\r\n		на Сайте.\r\n	</p>\r\n</div>',1,'2017-02-17 11:07:32'),(3,'Условия предоставления ПП SmetaWIZARD','request-agreement','<div class=\"container\">\r\n<h1>Условия предоставления ПП SmetaWIZARD</h1>\r\n		<h2>Лицензионное соглашение</h2>\r\n		<p>Программный продукт SmetaWIZARD (далее по тексту Программа), доступ к которому предоставляется посредством портала Valinta.ru, произведен и распространяется ЗАО «ВИЗАРДСОФТ», Россия, 192236, Санкт-Петербург, ул. Софийская д. 17, лит. А (в дальнейшем Производитель)  – это комплекс программ для ЭВМ, баз данных и документации, который является объектом авторского права и охраняется законом. Все условия, оговоренные далее, относятся как к Программе в целом, так и ко всем его компонентам в отдельности.</p>\r\n		<p>Авторские права на данную Программу принадлежат исключительно Лицензиару. Пользователю предоставляется право использования Программы, при соблюдении приведенных ниже условий и ограничений.</p>\r\n		<ol>\r\n		<li>Право на использование Программы на портале Valinta.ru  предоставляется исключительно Пользователю в рамках действующей лицензии на Программу.</li>\r\n			<li>Право на разовое использование Программы на портале Valinta.ru  предоставляется на безвозмездной основе сроком не более 3 (трех) рабочих дней.</li>\r\n			<li>Воспользоваться правом безвозмездного использования Программы Пользователь может не более 3 (трёх) раз.</li>\r\n			<li>Пользователь не  имеет право передавать право использования Программы на портале Valinta.ru  третьим лицам.</li>\r\n			<li>Конечный пользователь не имеет права разделять Программу на составные части, т.к. Программа лицензируется как единое целое.</li>\r\n			<li>Пользователь имеет право запускать Программу, используя удаленное подключение к рабочему столу, которое ему предоставлено Производителем, а также хранить созданную им документацию на удаленном рабочем столе (при этом Портал и Производитель не несут ответственности за сохранность документации) или на своем компьютере, с которого осуществляется вход на удаленный рабочий стол.</li>\r\n			<li>Пользователь не имеет права осуществлять вскрытие технологии, декомпиляцию и дизассемблирование Программы, за исключением тех случаев, которые разрешены действующим законодательством.</li>\r\n			<li>Пользователь обязуется не нарушать Российские и международные нормы авторского права по использованию программных средств.\r\n			<li>Пользователь не имеет права  использовать Программу для проведения  обучения  работе с Программой с целью получения коммерческой выгоды, без наличия договора с Производителем об осуществлении данной деятельности.</li>\r\n		</ol>\r\n		<p>В случае нарушения настоящего Лицензионного Соглашения Производитель лишает Пользователя права на использование Программы.</p>\r\n\r\n		<h2>Ограниченная гарантия</h2>\r\n		<p>Производитель в рамках бесплатного доступа к использованию Программы предоставляет консультации по работе с Программой:</p>\r\n		<ul>\r\n		<li>по телефонам «Горячей линии»: т.т.(812) 708-03-38, 708-03-48;</li>\r\n		<li>он-лайн консультации www.wizardsoft.ru, tp@wizardsoft.ru.</li>\r\n		</ul>\r\n		<p>Производитель придерживается политики непрерывного развития. Производитель оставляет за собой право вносить любые изменения и улучшения в Программу, который описан  в пользовательской документации, без предварительного уведомления.</p>\r\n		<p>Производитель не гарантирует то, что Программа будет соответствовать целям и задачам Пользователя.</p>\r\n		<p>Ни Производитель, ни другие фирмы или физические лица, имеющие отношение к созданию, производству или распространению Программу, ни при каких условиях не несут ответственности за какой-либо ущерб (включая  все без исключения случаи потери прибылей, прерывание деловой активности, потери деловой информации, либо другие денежные потери), связанный с использованием или невозможностью использования данной Программы.</p>\r\n<h2>Обработка персональных данных</h2>\r\n	<p>\r\n		Предоставляя свои персональные данные Пользователь даёт согласие на обработку, хранение и использование своих персональных\r\n		данных на основании ФЗ № 152-ФЗ «О персональных данных» от 27.07.2006 г. в следующих целях:\r\n	</p>\r\n	<ul>\r\n		<li>Регистрации Пользователя на сайте </li>\r\n		<li>Осуществление клиентской поддержки </li>\r\n		<li>Получения Пользователем информации о маркетинговых событиях </li>\r\n		<li>Выполнение Порталом обязательств перед Пользователем </li>\r\n		<li>Проведения аудита и прочих внутренних исследований с целью повышения качества предоставляемых услуг. </li>\r\n	</ul>\r\n	<p>\r\n		Под персональными данными подразумевается любая информация личного характера, позволяющая установить личность Пользователя\r\n		такая как:\r\n	</p>\r\n	<ul>\r\n		<li>Фамилия, Имя, Отчество</li>\r\n		<li>Контактный телефон </li>\r\n		<li>Адрес электронной почты </li>\r\n	</ul>\r\n	<p>\r\n		Персональные данные Пользователя хранятся исключительно на электронных носителях и обрабатываются с использованием автоматизированных\r\n		систем, за исключением случаев, когда неавтоматизированная обработка персональных данных необходима в связи с исполнением\r\n		требований законодательства.\r\n	</p>\r\n	<p>\r\n		Портал обязуется не передавать полученные персональные данные третьим лицам, за исключением следующих случаев:\r\n	</p>\r\n	<ul>\r\n		<li>\r\n			По запросам уполномоченных органов государственной власти РФ только по основаниям и в порядке, установленным законодательством\r\n			РФ\r\n		</li>\r\n	</ul>\r\n	<p>\r\n		Портал оставляет за собой право вносить изменения в одностороннем порядке в настоящие правила, при условии, что изменения\r\n		не противоречат действующему законодательству РФ. Изменения условий настоящих правил вступают в силу после их публикации\r\n		на Сайте.\r\n	</p>\r\n</div>',1,'2017-02-17 11:07:32'),(4,'Как правильно работать со сметчиком-фрилансером?','how-to-work-with-smetchik-freelancer','<div class=\"container\">\r\n<h2>Как правильно работать со сметчиком-фрилансером?</h2>\r\n<p>\r\nДовольно-таки распространенная практика в среде работодателей строительной отрасли привлекать к выполнению работ и оказанию услуг инженеров-сметчиков для разовой/временной или удаленной работы.\r\n</p>\r\n<p>\r\nНе будем сейчас углубляться, почему некоторым компаниям проще и выгодней пригласить к сотрудничеству именно удаленного специалиста. Причин для этого может быть множество. А вот понимать и знать, как с таким специалистом работать и как заключать с ним договор, было бы полезно каждому.\r\n</p>\r\n<p>\r\nНачнем с того, что можно нанять специалиста как удаленно, так и пригласить к сотрудничеству фрилансера. Между ними есть некоторые отличия. В первую очередь большинство фрилансеров выполняют свою работу как физические, а не юридические лица. К тому же фрилансер, это тот, кто может одновременно выполнять работы и оказывать услуги для неограниченного числа заказчиков, в то время как дистанционные работники осуществляют те же самые действия только для ограниченного числа работодателей, и то при условии, что каждый работодатель выражает своё согласие с «параллельным» трудоустройством. Удаленные сотрудники всегда выполняют работы и оказывают услуги на основании трудовых договоров, в то время как фрилансеры выполняют работы и оказывают услуги для компаний-заказчиков по договорам подряда, со своими особенностями оформления и заключения .\r\n</p>\r\n\r\n<ol>\r\nРассмотрим особенности заключения договора подряда с фрилансером:\r\n<li>Договор, как и все приложения к нему, должен быть составлен в письменной форме, за подписью руководителя компании и фрилансера;\r\n<li>Договор должен в обязательном порядке содержать явно выраженное указание на тот факт, что фрилансер по отношению к заказчику является независимым подрядчиком, и их отношения по договору не могут квалифицироваться как трудовые;\r\n<li>Если договор носит временный, а не разовый характер, то срок его действия должен завершаться сдачей определенного результата работ;\r\n<li>Предметом договора, опять же, должно быть выполнение конкретной работы, либо оказание определённой услуги на возмездной основе;\r\n<li>Полезным было бы расписать порядок приёмки-передачи работы от фрилансера к заказчику по завершении работ;\r\n<li>Необходимо указать точную сумму вознаграждения фрилансера и порядок оплаты данного вознаграждения за выполняемые фрилансером работы, с детализацией процедуры выплаты.\r\n</ol>\r\n\r\n<p>\r\nПри оформлении отношений с фрилансером у вас на руках должно быть как минимум три документа в письменной форме, подписанных самим фрилансером –  непосредственно договор и акт приёмки-передачи, который подписывает после сдачи готовой работы обеими сторонами.\r\n</p><br/>\r\n</div>',2,'2017-02-17 11:20:04'),(5,'Сколько стоит составить смету?','how-much-does-smeta-cost','<div class=\"container\">\r\n<h2>Сколько стоит составить смету?</h2>\r\n	<p>\r\n	Вопрос, который волнует не только заказчика, но и достаточно опытных сметчиков, которые сами признаются, что даже, имея огромный опыт за спиной, порой испытывают затруднения при расчете стоимости своей работы.</p>\r\n	<p>\r\n	Итак, как оценивать работу сметчиков? Стоит ли настороженно относиться к слишком привлекательной и низкой цене или же наоборот радоваться тому, что наткнулись на возможность сэкономить?\r\n	</p>\r\n	<p>\r\n	При составлении смет на отдельные виды работ, сметчик принимает за основу расчета наиболее важные сметные позиции, количество которых зависит от перечня выполняемых работ.\r\n	</p>\r\n	<p>\r\n	Стоит помнить, что на стоимость сметной документации влияет грамотно составленный проект, который во многом может облегчить работу сметчика, а следовательно и удешевить стоимость составления самой сметы. Сроки и регион, в котором будут производится работы также влияют на стоимость работы.\r\n	</p>\r\n\r\n	<ol>Основные правила расчета стоимости составления сметы:\r\n	<li>Стоимость работы формируется в зависимости от трудоемкости выполняемых работ;\r\n	<li>Срочность выполнения работы. Если смета нужна «вчера», она будет стоить дороже, чем если заказать ее расчет заранее;\r\n	<li>Есть специалисты, которые работают за процент от стоимости самой сметы;\r\n	<li>Как правило, молодые специалисты выполняют ту же работу, что и более опытные товарищи в разы дешевле. Тут вы должны сами делать выбор: дешево или надежно;\r\n	<li>Как правило, разовая работа стоит дороже постоянного сотрудничества.\r\n	</ol>\r\n\r\n	<p>\r\n	Так или иначе, как и в любых взаимоотношениях исполнителя и заказчика, все виды работ оцениваются для каждого отдельного случая индивидуально, по результатам разговора и запроса на работу.\r\n	</p><br/>\r\n</div>',2,'2017-02-17 11:20:04'),(6,'Как правильно выбрать сметчика?','how-to-choose-smetchik','<div class=\"container\">\r\n<h2>Как правильно выбрать сметчика?</h2>\r\n	<p>\r\n	Сметчик — это профессия, которая находится на стыке строительства и финансов, иначе сказать это специалист, который определяет стоимость строительства.\r\n	</p>\r\n	<p>\r\n	В обязанности сметчика входит не только составление и проверка смет, но и составление актов выполненных работ, а также расчет и согласование договорных цен на различные виды работ.\r\n	</p>\r\n	<p>\r\n	<ol>\r\n	Важные качества для работодателя, которыми должен обладать сметчик:\r\n	<li>Составление и проверка  проектно-сметной документации;</li>\r\n	<li>Знание и владение несколькими сметными программами;</li>\r\n	<li>Сметчик должен ориентироваться в технологии строительных работ, а также обладать достаточными познаниями в экономике, быть в курсе всех последних изменений в документах по ценообразованию;</li>\r\n	<li>Умение работать с цифрами, ведь сметчик, в том числе и бухгалтер на первом этапе составления документации;</li>\r\n	<li>Внимательность и аккуратность, ведь любая ошибка сметчика может дорого обойтись работодателю в прямом смысле этого слова.</li>\r\n	</ol>\r\n	</p><br/>\r\n</div>',2,'2017-02-17 11:20:04'),(7,'Политика конфиденциальности','privacy-policy','<div class=\"b-info__about\">\r\n	Политика конфиденциальности\r\n</div>\r\n<div class=\"container\">\r\n<div class=\"b-privacy-policy\">\r\n		\r\n		<div class=\"b-date clearfix\">\r\n			<span class=\"b-left\">г. Санкт-Петербург</span><span class=\"b-right\">«01» января  2017 г. </span>\r\n		</div>\r\n		<p>\r\n			Настоящая Политика конфиденциальности персональных данных (далее – Политика конфиденциальности) действует в отношении всей информации, которую Сервис VALINTA (далее Сервис),  расположенный на доменном имени <a href=\"http://www.valinta.ru\">\r\n			www.valinta.ru\r\n			</a>, может получить о Пользователе во время использования сайта Сервиса, программ и продуктов Сервиса. \r\n		</p>\r\n		<h2 class=\"b-center\">1. ОПРЕДЕЛЕНИЕ ТЕРМИНОВ</h2>\r\n		<ul>\r\n			<li>\r\n				1.1.	В настоящей Политике конфиденциальност