\r\n				3.4. Сервис осуществляет сбор статистики об IP-адресах своих посетителей. Данная информация используется с целью анализа статистики посещаемости сайта Сервиса.\r\n			</li>\r\n			<li>\r\n				3.5. Любая иная персональная информация неоговоренная выше (используемые браузеры и операционные системы и т.д.) подлежит надежному хранению и нераспространению, за исключением случаев, предусмотренных в п.п. 5.2. и 5.3. настоящей Политики конфиденциальности.\r\n			</li>\r\n		</ul>\r\n\r\n		<h2 class=\"b-center\">4.	ЦЕЛИ СБОРА ПЕРСОНАЛЬНОЙ ИНФОРМАЦИИ ПОЛЬЗОВАТЕЛЯ</h2>\r\n		<ul>\r\n			<li>\r\n				4.1. Персональные данные Пользователя Администрация сайта Сервиса может использовать в целях:\r\n			</li>\r\n			<li>\r\n				4.1.1. Предоставления Пользователю доступа к персонализированным ресурсам Сайта Сервиса.\r\n			</li>\r\n			<li>\r\n				4.1.2. Установления с Пользователем обратной связи, включая направление уведомлений, запросов, касающихся использования Сайта Сервиса, оказания услуг, обработка запросов и заявок от Пользователя.\r\n			</li>\r\n			<li>\r\n				4.1.3. Определения места нахождения Пользователя для обеспечения безопасности, предотвращения мошенничества.\r\n			</li>\r\n			<li>\r\n				4.1.4. Подтверждения достоверности и полноты персональных данных, предоставленных Пользователем.\r\n			</li>\r\n			<li>\r\n				4.1.5. Создания учетной записи для использования услуг Сервиса, если Пользователь дал согласие на создание учетной записи.\r\n			</li>\r\n			<li>\r\n				4.1.6. Предоставления Пользователю эффективной клиентской и технической поддержки при возникновении проблем связанных с использованием Сайта Сервиса. \r\n			</li>\r\n			<li>\r\n				4.1.7. Предоставления Пользователю с его согласия, обновлений продукции, специальных предложений, информации о ценах, новостной рассылки и иных сведений от имени Сервиса.\r\n			</li>\r\n			<li>\r\n				4.1.8. Осуществления рекламной деятельности с согласия Пользователя.\r\n			</li>\r\n		</ul>\r\n\r\n		<h2 class=\"b-center\">5.	СПОСОБ